import './Css/Home.css';
import './Css/NavBar.css';
import './Css/SearchBar.css';
import './Css/MainBanner1.css';
import './Css/MainBanner2.css';
import './Css/MainBanner3.css';

import NavBar from './Component/NavBar';
import Main from './Component/Main';

function Home() {
  return (
    <>
    <header>
        <NavBar/>
    </header>
    <article>
        <Main/>
    </article>
    <footer>

    </footer>
    </>
  );
}

export default Home;
